INSERT INTO `pertanyaan` VALUES (1, 'Mengatur ulang hal-hal di sekitar Anda sehingga masalah Anda sangat berpeluang terselesaikan.', 'Pemecahan Masalah', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (2, 'Menetapkan beberapa tujuan bagi diri Anda untuk menghadapi situasi.', 'Pemecahan Masalah', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (3, 'Mempertimbangkan pilihan Anda dengan sangat hati-hati.', 'Pemecahan Masalah', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (4, 'Mencoba berbagai cara untuk menyelesaikan masalah hingga Anda menemukan satu cara yang berhasil.', 'Pemecahan Masalah', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (5, 'Memfokuskan perhatian Anda sepenuhnya untuk memecahkan masalah.', 'Pemecahan Masalah', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (6, 'Menyusun rencana tindakan dalam pikiran Anda.', 'Pemecahan Masalah', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (7, 'Tetap tegar dan berusaha keras meraih apa yang Anda inginkan dalam situasi yang sedang dihadapi', 'Pemecahan Masalah', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (8, 'Mencoba memecahkan masalah.', 'Pemecahan Masalah', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (9, 'Mengungkapkan perasaan pada teman.', 'Dukungan Sosial', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (10, 'Berbicara dengan orang lain tentang situasi yang dihadapi, karena membicarakannya membantu Anda merasa lebih baik.', 'Dukungan Sosial', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (11, 'Mengungkapkan ketakutan dan kekhawatiran Anda kepada teman atau kerabat.', 'Dukungan Sosial', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (12, 'Menemui seseorang (teman atau profesional) untuk membantu Anda merasa lebih baik.', 'Dukungan Sosial', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (13, 'Menemui teman untuk membantu Anda merasa lebih baik tentang masalahnya.', 'Dukungan Sosial', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (14, 'Menemui teman untuk meminta nasihat tentang cara mengubah situasi.', 'Dukungan Sosial', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (15, 'Mencari kepastian dari orang-orang yang mengenal Anda dengan sangat baik.', 'Dukungan Sosial', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (16, 'Menghabiskan lebih banyak waktu dari biasanya dengan menyendiri.', 'Penghindaran', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (17, 'Menghindari berkumpul bersama orangorang pada umumnya.', 'Penghindaran', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (18, 'Berfantasi tentang bagaimana hal bisa berbeda.', 'Penghindaran', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (19, 'Menyamakan diri dengan karakter novel atau film.', 'Penghindaran', NULL, NULL, 'I');
INSERT INTO `pertanyaan` VALUES (20, 'Ketika saya dihadapkan pada situasi yang penuh tekanan, saya memikirkannya dengan cara yang membantu saya tetap tenang.', 'Penilaian Ulang', NULL, NULL, 'II');
INSERT INTO `pertanyaan` VALUES (21, 'Ketika saya ingin merasakan emosi yang lebih positif, saya mengubah cara saya memikirkan situasi.', 'Penilaian Ulang', NULL, NULL, 'II');
INSERT INTO `pertanyaan` VALUES (22, 'Saya mengendalikan emosi dengan cara memikirkan situasi yang sedang saya hadapi.', 'Penilaian Ulang', NULL, NULL, 'II');
INSERT INTO `pertanyaan` VALUES (23, 'Ketika saya ingin merasakan emosi yang sedikit lebih negatif, saya mengubah cara memikirkan situasi yang saya hadapi.', 'Penilaian Ulang', NULL, NULL, 'II');
INSERT INTO `pertanyaan` VALUES (24, 'Memikirkan betapa sulitnya berkonsentrasi.', 'Perenungan', NULL, NULL, 'III');
INSERT INTO `pertanyaan` VALUES (25, 'Memikirkan betapa pasif dan tidak termotivasinya perasaan Anda.', 'Perenungan', NULL, NULL, 'III');
INSERT INTO `pertanyaan` VALUES (26, 'Memikirkan bagaimana Anda tidak merasakan apa-apa lagi.', 'Perenungan', NULL, NULL, 'III');
INSERT INTO `pertanyaan` VALUES (27, 'Memikirkan bagaimana anda tidak merasa bersemangat untuk melakukan sesuatu.', 'Perenungan', NULL, NULL, 'III');
INSERT INTO `pertanyaan` VALUES (28, 'Memikirkan semua kekurangan, kegagalan, kesalahan Anda.', 'Perenungan', NULL, NULL, 'III');
INSERT INTO `pertanyaan` VALUES (29, 'Mencoba menemukan sesuatu yang positif dalam situasi atau sesuatu yang Anda pelajari.', 'Pengalihan', NULL, NULL, 'III');
INSERT INTO `pertanyaan` VALUES (30, 'Berpikir “Saya akan melakukan sesuatu untuk membuat diri saya merasa lebih baik.”', 'Pengalihan', NULL, NULL, 'III');
INSERT INTO `pertanyaan` VALUES (31, 'Melakukan sesuatu yang menyenangkan dengan seorang teman.', 'Pengalihan', NULL, NULL, 'III');
INSERT INTO `pertanyaan` VALUES (32, 'Saya menerima perasaan menyenangkan.', 'Penerimaan perasaan menyenangkan', NULL, NULL, 'IV');
